import React, { Component } from 'react';
import { ScatterChart,Scatter, CartesianGrid, XAxis, YAxis, Tooltip } from 'recharts';
const data01 = 
[{name: 'Page A', value: 400},
{name: 'Page B', value: 800},
{name: 'Page C', value: 1800},
{name: 'Page D', value: 700}];

const data02 = 
[{name: 'Page A', value: 1400},
{name: 'Page B', value: 500},
{name: 'Page C', value: 700},
{name: 'Page D', value: 1000}];

export default class ScatterChartWidget extends Component {
    render() {
        
      return ( 
<ScatterChart width={730} height={250}
  margin={{ top: 20, right: 20, bottom: 10, left: 10 }}>
  <CartesianGrid strokeDasharray="3 3" />
  <XAxis dataKey="x" name="stature" unit="cm" />
  <YAxis dataKey="y" name="weight" unit="kg" />
  <ZAxis dataKey="z" range={[64, 144]} name="score" unit="km" />
  <Tooltip cursor={{ strokeDasharray: '3 3' }} />
  <Legend />
  <Scatter name="A school" data={data01} fill="#8884d8" />
  <Scatter name="B school" data={data02} fill="#82ca9d" />
</ScatterChart>
     );
    }
  }
